import React, { useState, useEffect } from 'react';
import { Database, Smartphone, Gamepad2, Wrench, Globe, Star, Trophy } from 'lucide-react';
import { Card } from '../../components/Card';
import { Badge } from '../../components/Badge';
import { Checkbox } from '../../components/Checkbox';
import { InfoBox } from '../../components/InfoBox';
import { Tabs } from '../../components/Tabs';
import { Input } from '../../components/Input';
import { CodeBlock } from '../../components/CodeBlock';
import { CodeTabs } from '../../components/CodeTabs';
import { useLanguage } from '../../contexts/LanguageContext';

interface Step3Props {
  onComplete: () => void;
  appData: {
    appId: string;
    dataUrl: string;
    selectedVersion: 'saas' | 'private' | null;
  };
  onAppDataChange: (data: any) => void;
}

export const Step3DataIntegration: React.FC<Step3Props> = ({
  onComplete,
  appData,
  onAppDataChange
}) => {
  const { t } = useLanguage();
  const [understood, setUnderstood] = useState(false);
  const [hasRequiredData, setHasRequiredData] = useState(false);

  // 게이밍 테마
  const theme = {
    background: 'radial-gradient(ellipse at top, #1e1b4b 0%, #0f0f23 50%, #000000 100%)',
    cardBg: 'linear-gradient(145deg, rgba(30, 30, 60, 0.9), rgba(15, 15, 35, 0.9))',
    cardBorder: 'rgba(139, 92, 246, 0.3)',
    text: '#ffffff',
    textSecondary: '#a1a1aa',
    accent: '#06b6d4',
    accentSecondary: '#0891b2'
  };

  useEffect(() => {
    const hasData = appData.appId.trim() !== '' && appData.dataUrl.trim() !== '';
    setHasRequiredData(hasData);

    if (understood && hasData) {
      onComplete();
    }
  }, [understood, appData, onComplete]);

  const platformTabs = [
    {
      id: 'javascript',
      label: 'JavaScript',
      icon: <Globe size={16} />,
      content: getJavaScriptCode(appData)
    },
    {
      id: 'ios',
      label: 'iOS',
      icon: <Smartphone size={16} />,
      content: getIOSCode(appData)
    },
    {
      id: 'android',
      label: 'Android',
      icon: <Smartphone size={16} />,
      content: getAndroidCode(appData)
    },
    {
      id: 'unity',
      label: 'Unity',
      icon: <Gamepad2 size={16} />,
      content: getUnityCode(appData)
    },
    {
      id: 'unreal',
      label: 'Unreal',
      icon: <Gamepad2 size={16} />,
      content: getUnrealCode(appData)
    },
    {
      id: 'api',
      label: 'RESTful API',
      icon: <Wrench size={16} />,
      content: getAPICode(appData)
    }
  ];

  const tabs = platformTabs.map(platform => ({
    id: platform.id,
    label: (
      <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
        {platform.icon}
        {platform.label}
      </div>
    ),
    content: platform.content
  }));

  return (
    <div style={{ color: theme.text }}>
      {/* 게이밍 스타일 Step Title */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{
          display: 'flex',
          alignItems: 'center',
          gap: '16px',
          marginBottom: '20px',
          padding: '20px',
          background: 'rgba(6, 182, 212, 0.1)',
          borderRadius: '16px',
          border: `1px solid ${theme.cardBorder}`,
          position: 'relative',
          overflow: 'hidden'
        }}>
          {/* 배경 장식 */}
          <div style={{
            position: 'absolute',
            top: '-50%',
            right: '-20%',
            width: '100px',
            height: '100px',
            background: 'linear-gradient(135deg, rgba(6, 182, 212, 0.1), rgba(8, 145, 178, 0.1))',
            borderRadius: '50%',
            filter: 'blur(30px)'
          }} />

          <div style={{
            width: '60px',
            height: '60px',
            background: 'linear-gradient(135deg, #06b6d4, #0891b2)',
            borderRadius: '18px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            boxShadow: '0 8px 20px rgba(6, 182, 212, 0.4)',
            position: 'relative',
            zIndex: 1
          }}>
            <Database size={28} color="white" />
          </div>
          <div style={{ position: 'relative', zIndex: 1 }}>
            <h3 style={{
              fontSize: '28px',
              fontWeight: '800',
              background: 'linear-gradient(135deg, #06b6d4, #0891b2)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              margin: 0,
              marginBottom: '8px'
            }}>
{t('step3.mission')} 🔗
            </h3>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '12px'
            }}>
              <span style={{
                fontSize: '14px',
                color: theme.textSecondary,
                padding: '4px 12px',
                background: 'rgba(6, 182, 212, 0.2)',
                borderRadius: '12px',
                fontWeight: '600'
              }}>
                {t('step3.levelLabel')}
              </span>
              <span style={{
                fontSize: '14px',
                color: '#f59e0b',
                display: 'flex',
                alignItems: 'center',
                gap: '4px'
              }}>
                <Star size={16} />
                {t('step3.rewardXP')}
              </span>
            </div>
          </div>
        </div>
        <p style={{
          fontSize: '18px',
          color: theme.textSecondary,
          lineHeight: '1.6',
          margin: 0,
          padding: '0 20px'
        }}>
          <span dangerouslySetInnerHTML={{ __html: t('step3.goal') }} />
        </p>
      </div>

      {/* 게이밍 스타일 App Configuration */}
      <div style={{ marginBottom: '32px' }}>
        <div style={{
          padding: '28px',
          background: theme.cardBg,
          border: `1px solid ${theme.cardBorder}`,
          borderRadius: '20px',
          boxShadow: '0 8px 24px rgba(0, 0, 0, 0.2)',
